import React from 'react';
import Logo from './Logo';
import BestPokemon from './BestPokemon';
import CaughtPokemon from './CaughtPokemon';
let abilities = [ 'Anticipation', 'Adaptability', 'Run-Away' ];

function App() {
	return (
		<div>
			<Logo appName="Pokedex"/>
			<BestPokemon />
			<CaughtPokemon />
		</div>
	);
}

export default App;
